import React, { useEffect, useState } from "react";

const ImagesresH = ({ catfilter }) => {
  const [data, setData] = useState([""]);
  const [url, setUrl] = [
    `https://pixabay.com/api/?key=38320105-b762e964374d782b30b2f8654&image_type=All&pretty=true`,
  ];

  useEffect(() => {
    fetch(url)
      .then((res) => res.json())
      .then((imgdata) => {
        // console.log(imgdata.hits);
        setData(imgdata.hits);
      });
  });

  const updatecaturl = (catfilter) => {
    setUrl(
      `https://pixabay.com/api/?key=38320105-b762e964374d782b30b2f8654&image_type=${catfilter}&pretty=true`
    );
  };

  return (
    <>
      <div className="ImagesresH-box">
        <div className="imagesss">
          {data.map((res) => {
            // console.log(res.webformatURL);
            return (
              <>
                <div className="img-res" onClick={() => alert(res.id)}>
                  <img
                    className="on-img"
                    src={res.webformatURL}
                    alt="img.jpg"
                  />
                </div>
              </>
            );
          })}
        </div>
      </div>
    </>
  );
};

export default ImagesresH;
